import React, { useState } from 'react'

function Search({setCoursesOnDisplay}) {
  const inputBox = document.getElementById("inputBox");
  const searchButt = document.getElementById("searchButt");

  const [searchCourse, setSearchCourse] = useState([]);

  const defaultCourseArray = [
    { name: "Hustlers University 1.0" ,img:'data:image/jpeg;base64,'},
    { name: "Hustlers University 2.0", img:'data:image/jpeg;base64,' },
    { name: "Hustlers University 3.0", img:'data:image/png;base64,' },
  ];

  

  const HandleUserInput = (self) => {
    const searchButtp2 = document.getElementById("searchButt").style;
    const searchword = self.target.value;
    const newArray = defaultCourseArray.filter((value) => {
      return value.name.toLowerCase().includes(searchword.toLowerCase());
    });
    if (searchword === "") {
      setSearchCourse([]);
      searchButtp2.color = "";
      setCoursesOnDisplay(defaultCourseArray);
    } else {
      setSearchCourse(newArray);
      searchButtp2.color = "";
      setCoursesOnDisplay(defaultCourseArray)
    }
    defaultCourseArray.forEach((element) => {
      if (element.name.toLowerCase() === searchword.toLowerCase()) {
        setSearchCourse([]);
        searchButtp2.color = "#5ed55e";
      }
    });
    
  };


  const Searchit = () => {
    if (searchButt.style.color === "rgb(94, 213, 94)") {
      const passArray = defaultCourseArray.filter((elements) => {
        return elements.name.toLowerCase() === inputBox.value.toLowerCase();
      });
      setCoursesOnDisplay([...passArray]);
    } else {
      console.log("denied");
    }
  };

  return (
    <div className="bg-Dubai bg-cover bg-center w-screen h-3/4 flex flex-col items-center justify-center">
      <h2 className="relative text-3xl bold italic bottom-20 mr-36">
        “If failure makes you stronger, you can never lose.”
      </h2>
      <div className='relative'>
        <input
          className="h-12 w-96 pl-10"
          placeholder="Search for course..."
          onChange={HandleUserInput}
          id="inputBox"
        />
        <button
          className="p-3 pl-6 pr-6 bg-black text-white"
          id="searchButt"
          onClick={Searchit}
        >
          SEARCH
        </button>

{/* ----------------\/ This is the search bar suggestions that is being mapped \/ --------------*/}
        {searchCourse.length !== 0 && (
          <div className="bg-white w-96 h-fit border pl-10 absolute" id="searchList">
            <ul>
              {searchCourse.map((elements, index) => {
                return (
                  <li
                    key={index}
                    className="border w-96 pl-10 relative right-10 hover:cursor-pointer"
                    onClick={() => {
                      inputBox.value = elements.name;
                      searchButt.style.color = "#5ed55e";
                      setSearchCourse([]);
                    }}
                  >
                    {elements.name}
                  </li>
                );
              })}
            </ul>
          </div>
        )}
      </div>
    </div>
  );
}

export default Search